import { styled } from "styled-components";

export const Container = styled.div`
  width: 393px;
  height: 816px;
  background: #38145d;
`;

export const Bar = styled.div`
  display: flex;
  flex-direction: row;
  width: 393px;
  height: 44px;
  flex-shrink: 0;
  #Time {
    margin-top: 15px;
    margin-left: 15px;
    float: left;
    color: #fff;
    text-align: center;
    font-family: "Pretendard Variable";
    font-size: 18px;
    font-style: normal;
    font-weight: 500;
    line-height: 25px; /* 138.889% */
    width: 80px;
  }
  #Connection {
    margin-top: 17px;
    margin-left: 220px;
    width: 16px;
    height: 12.173px;
    flex-shrink: 0;
    color: #fff;
  }
  #Wifi {
    margin-top: 17px;
    margin-left: 15px;
    width: 16px;
    height: 12.173px;
    flex-shrink: 0;
    color: #fff;
  }
  #Battery {
    margin-top: 17px;
    margin-left: 10px;
    margin-right: 8px;
    width: 25px;
    height: 12.173px;
    flex-shrink: 0;
    color: #fff;
  }
`;
